import React from "react";
import "./Triangle.css"

class Triangle extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            null: null
        }
    }

    render() {
        return (
            <div id="container-de-triangulo">
                <img src="images/bg-triangle.svg" alt="triangle" />
                <button>
                    <img src="images/icon-rock.svg" id="Rock" alt="Rock" />
                    <img src="images/icon-scissors.svg" id="Scissors" alt="Scissors" />
                    <img src="images/icon-paper.svg" id="Paper" alt="Paper" />
                </button>
                <button>
                <img src="images/icon-scissors.svg" id="Scissors" alt="Scissors" />
                </button>
            </div>
        )
    }
}

export default Triangle
